import {Layout, Card, Avatar, Menu, Dropdown, Space, Divider} from "antd";
import Sider from "antd/es/layout/Sider";
import {Content, Footer, Header} from "antd/es/layout/layout";
import {DownOutlined, SmileOutlined} from "@ant-design/icons";
const menu = (
    <Menu
        items={[
            {
                label: (
                    <a target="_blank" rel="noopener noreferrer" href="https://www.antgroup.com">
                        1st menu item
                    </a>
                ),
            },
            {
                label: (
                    <a target="_blank" rel="noopener noreferrer" href="https://www.aliyun.com">
                        2nd menu item (disabled)
                    </a>
                ),
                icon: <SmileOutlined />,
                disabled: true,
            },
            {
                label: (
                    <a target="_blank" rel="noopener noreferrer" href="https://www.luohanacademy.com">
                        3rd menu item (disabled)
                    </a>
                ),
                disabled: true,
            },
            {
                danger: true,
                label: 'a danger item',
            },
        ]}
    />
);

export function ChatLayout({message}){
    return(
        <>
            <div className="container mx-auto">
                <Card className="h-screen">
                    <div className="flex justify-center items-center border-b pb-6">
                        Hola Chat
                    </div>
                    <div className="grid grid-cols-12 h-[calc(100vh-100px)]">
                        <div className="col-span-1 border-r pr-6 pt-6">
                           <div className="space-y-4 flex flex-col justify-center items-center">
                               <Avatar size="large"  src="https://joeschmoe.io/api/v1/random"  />
                               <div className="">
                                   <Dropdown overlay={menu}>
                                       <a onClick={e => e.preventDefault()}>
                                           <Space>
                                               Hover me
                                               <DownOutlined />
                                           </Space>
                                       </a>
                                   </Dropdown>
                               </div>
                           </div>
                            <Divider />

                        </div>
                        <div className="col-span-4 border-r pr-6">
                            dfnf
                        </div>
                        <div className="col-span-7">
                            dffdz
                        </div>
                    </div>
                </Card>
            </div>
        </>
    )
}
